import logo from './logo.svg';
import './App.css';
import {useState, useEffect} from "react";

function App() {
  const[categories, setCategories] = useState({});

  useEffect(()=>{
    fetch('/categories')
        .then(res => res.json())
        .then(categories => setCategories(categories))
  })
  return (
  <div></div>
  );
}

export default App;
